styles.content:
self {
  text-align: center;
  font-size: 16px;
  transition: 0.2s;
  border-bottom: 0.2rem solid;
	border-color: transparent;
	cursor: pointer;
}

self:hover, self:focus  {
  border-bottom: 0.2rem solid;
	border-color: #f7ce46;
}

self {
background-color: #f7ce46;
  transition: background 0.3s;

}

self:hover
{
	background-color: #fae279;
}

self {
background-color: white;
  transition: background 0.3s;

}

self:hover
{
	background-color: #e5e5e5;
}

self {
  background: linear-gradient(transparent, transparent 50%, #f7ce46 50%, #f7ce46);
  background-size: 100% 200%;
  /*trasition effect for background*/
  transition: background 0.3s;
}

self:hover {
  background-position: 100% 100%;
}

self { 
	position: absolute; 
	background-color: white;
	overflow: auto; 
	box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2); 
	z-index: 1;
}

self p:hover {
	background-color: #f7ce46;
	color: white;}

self {
 position: relative;
   display: inline-block;
}

self:hover .childMenuCSS {
	display: block !important;
	background-color: white}
